import React from 'react';
import { useLocation } from "react-router-dom";

import { Card, CardHeader, Container, Typography } from '@material-ui/core';

import Header from '../Header/';

const Campeoes = () => {

  let location = useLocation();
  const campeoes = location.state;

  return (
    <Container>
      <Header
        titulo="Campeonato de Filmes"
        subtitulo="Resultado Final"
        descricao="Veja o resultado final do Campeonato de Filmes de forma simples e rÃ¡pida"
      />

      {campeoes.map(campeao =>
        <Card key={campeao.id}>

          <Typography variant="h2">{campeao.titulo}</Typography>

        </Card>
      )}

    </Container>
  )
}

export default Campeoes;
